ormal\"><span>First of\nall, how can we explain one\u2019s fascination for urine and all the sex games that\nare involving it? <o:p></o:p></span></p>\n<p class=\"MsoNormal\"><span>Well, the\nanswer is simple: it is all part of the dominant/submissive game. The\nsubmissive wants to feel degraded and humiliated, while used as an object and\nthe dominant wants to feel the arousing feeling of domination through the act\nof urination. <o:p></o:p></span></p>\n<p class=\"MsoNormal\"><span>This type of\nfetish is called \u201curolagnia\u201d or \u201curophilia\u201d and it refers to sexual arousal\nassociated with urine and urination. The golden shower it is just a small part\nof what urolagnia really means.&nbsp;</span></p>\n<p class=\"MsoNormal\"><span><br/></span></p>\n<p class=\"MsoNormal\"><span>Here are just a few <b>fetishes derived from\nurolagnia</b>:</span></p>\n<p class=\"MsoNormal\"><span><br/></span></p>\n<p class=\"MsoNormal\"><img border=\"0\" alt=\"\" align=\"left\" width=\"250\" height=\"375\" src=\"/uploads/blog/shutterstock_98007848_2.jpg\"/>1. &nbsp; &nbsp; &nbsp; &nbsp;<b>Omorashi</b><b>&nbsp;</b>\u2013\nit\u2019s the Japanese word for \u201cwetting oneself\u201d. This fetish involves the act of\nholding in the need to pee until the very last moment. It is a common\nsubmissive/dominant game, between master and slave, when the master demands the\nslave to hold on the urge to pee. The master gains pleasure from watching the\ntormented facial expressions of the submissive, while the submissive may even\norgasm from the sensation given by a full bladder.</p>\n<p class=\"MsoListParagraphCxSpFirst\"><span><br/></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\"><!--[if !supportLists]--><span>2.<span times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><b><span>Pee related voyeurism</span></b><span> \u2013 the act of secretly watching someone taking a leak and getting aroused\r\nby that, as a way of exhibitionism.<o:p